import React from 'react'
import './App.css'
import Header from './Header'
import AddContact from './AddContact'
import ContactList from './ContactList'
import ContactCard from './ContactCard'



function App() {

	const contacts=[
		{
			id:"1",
			name:"suresh",
			emial:"suresh@email.com"
		},
		{
			id:"2",
			name:"ramesh",
			emial:"ranesh@email.com"
		},
		{
			id:"3",
			name:"sumesh",
			emial:"sumesh@email.com"
		},
		{
			id:"4",
			name:"sukesh",
			emial:"sukesh@email.com"
		},
	]

	return (
        <div className="App">
     <Header />
	<AddContact />
	<ContactList contacts={contacts} />
		</div>
	)
}

export default App
